const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
        <Header course={course}/>
        <Part parts={parts}/>
        <Total e1={parts[0].exercises} e2={parts[1].exercises} e3={parts[2].exercises}/>
    </div>
  )
}

const Header = (props) =>{
    console.log(props)
    return(
    <div>
        <h1>
            {props.course}
        </h1>
    </div>
    )
}

const Content = (props) =>{
    console.log(props)
    return(
    <div>   
        <Part pp={props.parts.name} ee={props.parts.exercises} />
    </div>
)
}

const Part = (props) =>{
    console.log(props)
return(
    <div>
        <p>
            {props.pp[0]} {props.ee}
        </p>
    </div>
)
}

const Total = (props) =>{
    console.log(props)
    return(
    <div>
        <p>
            number of exercises {props.e1+props.e2+props.e3}
        </p>
    </div>
)
}
export default App
